import FeedbackPage from './FeedbackPage';
import { useNavigate } from 'react-router-dom';
const ProfilePage = (props) => {

    const navigate = useNavigate();

    function handleviewFeedBack(){
        console.log(user.feedback);
        navigate(`/profile/${user.username}/feedback`, {state: {'feedback' : user.feedback}});
    }

    return(
    <>
        <h2>User Details</h2>
        <form>
            <label>Name: </label>
            <input type="text" value={props.user.name ? user.name : ''} /><br />
            <label>Username: </label>
            <input type="text" value={props.user.username} disabled/><br />
            <label>Email: </label>
            <input type="email" value={props.user.email} disabled/><br />
            <label>Contact: </label>
            <input type="number" value={props.user.contact? user.contact: ''} /><br />
            <label>Country: </label>
            <input type="text" value={props.user.country} /><br />
            <button onClick={handleviewFeedBack}>View FeedBacks</button>
        </form>
    </>
    )
}

export default ProfilePage;
